# Create the main window
root = Tk()

# Define the image file path
image_file = "pixeles/1.png"

# Create the image object
image = PhotoImage(file=image_file)

def create_button_grid():
    # Create the grid of buttons using a list comprehension
    buttons = [[Button(root, image=image, bd=0) for _ in range(len(matriz[0]))] for _ in range(len(matriz))]
    for i, row in enumerate(buttons):
        for j, btn in enumerate(row):
            btn.config(image=image)
            btn.grid(row=i, column=j)

# Call the function to create the grid of buttons
create_button_grid()

# Start the main loop
root.mainloop()